import React from 'react'; 

class Signin  extends React.Component{
    onEmailChange = (event) =>{
        this.setState({signInEmail: event.target.value})
    }
    onPasswordChange = (event) =>{
        this.setState({signInPassword: event.target.value})
    }
    
    render(){
        const { cambioDeRuta } = this.props;
        return(
            <div>
            <main className="pa4 black-80">
                <div className="measure center bg-white pa5 .shadow-2 trans">
                <fieldset id="sign_up" className="ba b--transparent ph0 mh0">
                     <legend className="f4 fw6 ph0 mh0">Ingresar</legend>
                    <div className="mt3">
                        <label className="db fw6 lh-copy f6" htmlFor="email-address">Correo</label>
                        <input className="pa2 input-reset ba bg-transparent hover-bg-black hover-white w-100" type="email" name="email-address"  id="email-address"/>
                    </div>
                    <div className="mv3">
                        <label className="db fw6 lh-copy f6" htmlFor="password">Password</label>
                        <input className="b pa2 input-reset ba bg-transparent hover-bg-black hover-white w-100" type="password" name="password"  id="password"/>
                    </div>
                </fieldset>
                <div className="">
                     <input 
                     onClick={()=> cambioDeRuta('home')}
                     className="b ph3 pv2 input-reset ba b--black bg-transparent grow pointer f6 dib" type="submit" 
                     value="Ingresar"/>
                </div>
                <div className="lh-copy mt3">
                <p 
                onClick={()=>cambioDeRuta('register')}
                className="f6 link dim black db pointer">Registrarse
                </p>
                </div>
                </div>
            </main>

        </div>
        )
    }
}

export default Signin;
